              "textDisplay": "@Guardiano A black hole also isn&#39;t a hole at all. It&#39;s a collapsed star and we have images of these. \u003cbr\u003e\u003cbr\u003eSchwarzchild and Einsteins theories were used to predict how a black hole would interact with objects, including light. And, from the recent images captured, we can yet again show that the equations and theories written up by both of these incredible people are in fact accurate! Also, these equations were able to predict wormholes and white holes too. They are also used to calculate how time would slow down, potentially stop and even reverse inside as you got closer and closer to the black hole&#39;s core (dependant on the mass of the black hole and original mass of the star before it collapsed). \u003cbr\u003e\u003cbr\u003e&quot;Just theory&quot; doesn&#39;t stand in science. It&#39;s a hypothesis until observably definitive through highly controlled experiments. Then, and only then, does something become scientific theory. There must be established fact. Then, from that fact, you can derive opinions and hypotheses which then lead you to more experiments, calculations and challenges to prove them right or wrong. \u003cbr\u003e\u003cbr\u003eGo read something other than Internet drivel.",
              "textOriginal": "@Guardiano A black hole also isn't a hole at all. It's a collapsed star and we have images of these. \n\nSchwarzchild and Einsteins theories were used to predict how a black hole would interact with objects, including light. And, from the recent images captured, we can yet again show that the equations and theories written up by both of these incredible people are in fact accurate! Also, these equations were able to predict wormholes and white holes too. They are also used to calculate how time would slow down, potentially stop and even reverse inside as you got closer and closer to the black hole's core (dependant on the mass of the black hole and original mass of the star before it collapsed). \n\n\"Just theory\" doesn't stand in science. It's a hypothesis until observably definitive through highly controlled experiments. Then, and only then, does something become scientific theory. There must be established fact. Then, from that fact, you can derive opinions and hypotheses which then lead you to more experiments, calculations and challenges to prove them right or wrong. \n\nGo read something other than Internet drivel.",
