            "id": "UgymZiI2icLZcfFutwZ4AaABAg.9gL-3xW2C3-9k-B7diLd-6",
            "snippet": {
              "videoId": "yuD34tEpRFw",
              "textDisplay": "One thing I think people get wrong in these thought experiments is when you say &quot;if I&#39;m moving at the speed of light...&quot;. Movement is relative, so you have to measure your speed against something else. You may be moving at the speed of light compared to Earthbut you may be moving at a different speed compared to something else. You are always static compared to yourself. So if you are moving away from Earth at the speed of light and you turn a flashlight on pointing forward, you will just see the light move away from you at the speed of light, because the flashlight is static to you. People in Earth would see both you and the light moving away at the speed of light. I&#39;m no physicist though but this is what I understand from all this.",
              "textOriginal": "One thing I think people get wrong in these thought experiments is when you say \"if I'm moving at the speed of light...\". Movement is relative, so you have to measure your speed against something else. You may be moving at the speed of light compared to Earthbut you may be moving at a different speed compared to something else. You are always static compared to yourself. So if you are moving away from Earth at the speed of light and you turn a flashlight on pointing forward, you will just see the light move away from you at the speed of light, because the flashlight is static to you. People in Earth would see both you and the light moving away at the speed of light. I'm no physicist though but this is what I understand from all this.",
