            "etag": "PukHgZp3KFiEPFm5nOJpTM-2e3Q",
            "id": "UgymZiI2icLZcfFutwZ4AaABAg.9gL-3xW2C3-9jM3gbd99FU",
            "snippet": {
              "videoId": "yuD34tEpRFw",
              "textDisplay": "@KT420ish If you are at or near the speed of light, holding a torch, to you the light from the torch would look normal since you, as the observer, are effected by your speed just as much as the light is. Your time would slow downbut you wouldn&#39;t notice. To everyone else who is not moving so fast, they would see the light as a different colour to you due to Doppler shift.\u003cbr\u003e\u003cbr\u003eAlso remember that when we talk about measuring the speed of light, it can&#39;t be measured in the same way that we measure other moving objects. We always need to make the light perform a round trip (away and return). The average speed of the round trip is the speed of light. No one has yet been able to measure the speed of light in a single direction (e.g. only moving away). There are some good videos on this. So it can&#39;t be proven whether light slows down when moving away from you (say, in your scenario), then returns at greater than the speed of light on the return. Whatever it does, the average round trip speed always comes out as the speed of light.",
              "textOriginal": "@KT420ish If you are at or near the speed of light, holding a torch, to you the light from the torch would look normal since you, as the observer, are effected by your speed just as much as the light is. Your time would slow downbut you wouldn't notice. To everyone else who is not moving so fast, they would see the light as a different colour to you due to Doppler shift.\n\nAlso remember that when we talk about measuring the speed of light, it can't be measured in the same way that we measure other moving objects. We always need to make the light perform a round trip (away and return). The average speed of the round trip is the speed of light. No one has yet been able to measure the speed of light in a single direction (e.g. only moving away). There are some good videos on this. So it can't be proven whether light slows down when moving away from you (say, in your scenario), then returns at greater than the speed of light on the return. Whatever it does, the average round trip speed always comes out as the speed of light.",
