          "snippet": {
            "videoId": "yuD34tEpRFw",
            "textDisplay": "\u003ca href=\"https://www.youtube.com/watch?v=yuD34tEpRFw&amp;t=1m08s\"\u003e1:08\u003c/a\u003e In my opinion, it&#39;s already obvious that moving in any speeds (even slow or faster than light) doesn&#39;t make the real time faster.\u003cbr\u003e\u003cbr\u003eIf the speed of light is infinite, time dilation would not exist, and I think that would be great. But the speed of light is not infinite, so there&#39;s a delay in how you would perceive light.\u003cbr\u003e\u003cbr\u003eWe humans use our eyes to look what time it is, and vision is about perceiving light, and light travels very fast but not infinitely fast.\u003cbr\u003e\u003cbr\u003eThere will always be a delay when light reaches you, so everything you see right now is delayed (even if it&#39;s very very slight). Like look at the Sun, that&#39;s the sun 8 minutes ago. Or look at your hand, that&#39;s what your hand looks like 0.00000...1 microseconds ago for example.",
            "textOriginal": "1:08 In my opinion, it's already obvious that moving in any speeds (even slow or faster than light) doesn't make the real time faster.\n\nIf the speed of light is infinite, time dilation would not exist, and I think that would be great. But the speed of light is not infinite, so there's a delay in how you would perceive light.\n\nWe humans use our eyes to look what time it is, and vision is about perceiving light, and light travels very fast but not infinitely fast.\n\nThere will always be a delay when light reaches you, so everything you see right now is delayed (even if it's very very slight). Like look at the Sun, that's the sun 8 minutes ago. Or look at your hand, that's what your hand looks like 0.00000...1 microseconds ago for example.",
